// src/admin/pages/Dashboard.js
import React from 'react';
import { Link } from 'react-router-dom';
import './Dashboard.css'; // Optional: Create a CSS file for additional styling

const AdminDashboard = () => {
  return (
    <div className="admin-dashboard-container">
      <h2>Admin Dashboard</h2>
      <div className="admin-dashboard-buttons">
        <Link to="/admin/user-management">
          <button>User Management</button>
        </Link>
        <Link to="/admin/report-generation">
          <button>Report Generation</button>
        </Link>
        <Link to="/admin/system-monitoring">
          <button>System Monitoring</button>
        </Link>
        <Link to="/admin/settings">
          <button>Settings</button>
        </Link>
        <Link to="/admin/issue-resolution">
          <button>Issue Resolution</button>
        </Link>
        <Link to="/admin/logout">
          <button>Logout</button>
        </Link>
      </div>
    </div>
  );
};

export default AdminDashboard;
